function str2uni($tmpStr)          
{   
  global $uni;         
  $retStr="";          
  for($i=0;$i<strlen($tmpStr);$i+=$step)  
    if(($step=(ord(substr($tmpStr,$i,1))>127)?2:1)==2)  
    {  
      $idx=base_convert(bin2hex(substr($tmpStr,$i,$step)),16,10)-base_convert("8141",16,10);
      $retStr.=($idx>=0)?"&#".$uni[$idx].";":substr($tmpStr,$i,$step);  
    }  
    else          
      $retStr.=substr($tmpStr,$i,$step);  
                  
  return $retStr;          
}
